import React, { Component } from 'react';
import Slider from 'react-slick';
import "slick-carousel/slick/slick.css";
import "slick-carousel/slick/slick-theme.css";
import "./styles.scss";

class GraphicsCard extends Component {
    render() {
        const settings = {
            dots: false,
            infinite: true,
            speed: 500,
            slidesToShow: 3,
            slidesToScroll: 3,
            responsive: [
              {
                breakpoint: 1025,
                settings: {
                  slidesToShow: 3,
                  slidesToScroll: 3,
                  infinite: true,
                },
              },
              {
                breakpoint: 769,
                settings: {
                  slidesToShow: 2,
                  slidesToScroll: 2,
                  initialSlide: 2,
                },
              },
              {
                breakpoint: 481,
                settings: {
                  slidesToShow: 1,
                  slidesToScroll: 1,
                },
              },
            ],
          };
        return (
           <div className="container-fluid" id="graphics-card">
                <div className="container title">
                    <h2>GRAPHICS CARDS</h2>
                    <Slider {...settings}>
                        <div className="slide-item">
                            <img src="https://www.aorus.com/assets/img/graphics-cards-aorus.58760d9d.png" className="w-100" alt="" />
                        </div>
                        <div className="slide-item">
                            <img src="https://www.aorus.com/assets/img/graphics-cards-aorus.58760d9d.png" alt="" />
                        </div>
                        <div className="slide-item">
                            <img src="https://www.aorus.com/assets/img/graphics-cards-aorus.58760d9d.png" alt="" />
                        </div>
                    </Slider>
                </div>
           </div>
        );
    }
}

export default GraphicsCard;
